export default class Post {
  constructor(id, parentId, imgsrc, text, postby) {
    this.id = id;
    this.parentId = parentId;
    this.children = [];
    this.imgsrc = imgsrc;
    this.text = text;
    this.date = new Date();
    this.postby = postby;
  }
}
